마련한 별도의 사업장을 말하며, 아울러 미니쉬라운지에 입점한 사업자들의 사업장의 의미로도 사용합니다.<br>\\n                    \\n                    2.\\t\\\"온라인 ID\\\"란 \\\"미니쉬라운지\\\"에서 동일 ID, 비밀번호로 로그인 할 수 있으며 각 \\\"미니쉬라운지\\\" 의 적립금(포인트)을 통합 운영하는 회원을 위한 통합제도를 말합니다.<br>\\t\\t\\n                    3.\\t\\\"이용자\\\" 란 \\\"미니쉬라운지\\\" 에 접속하여 이 약관에 따라 \\\"미니쉬라운지\\\" 가 제공하는 서비스를 받는 회원 및 비회원을 말합니다.<br>\\n                    \\n                    4.\\t\\\"회원\\\" 이라 함은 \\\"미니쉬라운지\\\" 에 개인정보를 제공하여 회원등록을 한 자로서, \\\"미니쉬라운지\\\" 의 정보를 지속적으로 제공받으며, \\\"미니쉬라운지\\\" 가 제공하는 서비스를 계속적으로 이용할 수 있는 자를 말합니다.<br>\\n                    5.\\t\\\"비회원\\\"이라 함은 회원에 가입하지 않고 \\\"미니쉬라운지\\\"에서 제공하는 서비스를 이용하는 자를 말합니다.<br>\\n                    6.\\t\\\"라운지 멤버십 포인트\\\" 란 회원이 \\\"미니쉬라운지\\\" 에서 상품 및 서비스를 추천 또는 구매할 경우 이에 부수하여 일정 적립률에 따라 현금대체 결제 수단으로 사용할 수 있는 사이버머니를 의미하며, 미니쉬테크의 정책에 따라 고객 서비스를 변경하여 제공할 수 있습니다.               \\n                </li>\\n                <li>\\n                    <h3>제3조 (약관등의 명시와 설명 및 개정)</h3>\\n                    1.\\t\\\"미니쉬라운지\\\" 는 이 약관의 내용과 상호 및 대표자 성명, 영업소 소재지 주소(소비자의 불만을 처리할 수 있는 곳의 주소를 포함), 전화번호, 모사전송번호, 전자우편주소, 사업자등록번호, 통신판매업신고번호, 개인정보관리책임자 등을 이용자가 쉽게 알 수 있도록 \\\"미니쉬라운지\\\" 의 초기 서비스화면(전면)에 게시합니다. 다만, 약관의 내용은 이용자가 연결화면을 통하여 볼 수 있도록 할 수 있습니다.<br>\\n                    \\n                    2.\\t\\\"미니쉬라운지\\\" 는 이용자가 약관에 동의하기에 앞서 약관에 정해져 있는 내용 중 청약철회, 배송책임, 환불조건 등과 같은 중요한 내용을 이용자가 이해할 수 있도록 별도의 연결화면 또는 팝업화면 등을 제공하여 이용자의 확인을 구하여야 합니다.<br>\\n                    3.\\t\\\"미니쉬라운지\\\" 는 전자상거래 등에서의 소비자보호에 관한 법률, 약관의 규제에 관한 법률, 전자거래기본법, 전자서명법, 정보통신망이용촉진 등에 관한 법률, 소비자보호법, 개인정보보호법 등 관련법을 위배하지 않는 범위에서 이 약관을 개정할 수 있습니다.<br>\\n                    \\n                    4.\\t\\\"미니쉬라운지\\\" 가 약관을 개정할 경우에는 적용일자 및 개정사유를 명시하여 현행 약관과 함께 사이트 초기화면에 그 적용일자 7일 이전부터 적용일자 전일까지 공지합니다.다만, 이용자에게 불리하게 약관내용을 변경하는 경우에는 최소한 30일 이상의 사전 유예기간을 두고 공지합니다. 이 경우 \\\"미니쉬라운지\\\" 는 개정전 내용과 개정후 내용을 명확하게 비교하여 이용자가 알기 쉽도록 표시합니다.<br>\\n                    \\n                    5.\\t\\\"미니쉬라운지\\\" 가 약관을 개정할 경우에는 그 개정약관은 그 적용일자 이후에 체결되는 계약에만 적용되고 그 이전에 이미 체결된 계약에 대해서는 개정전의 약관조항이 그대로 적용됩니다.<br>\\n                            \\n                    6.\\t회원이 개정된 약관에 동의하지 않을 경우, 회원은 회원탈퇴(이용계약의 해지)를 “미니쉬라운지”에 요청할 수 있으며, 미니쉬테크가 제4항에 따라 회원에게 공지하면서 공지 혹은 고지일로부터 개정약관 시행일 7일 후까지 거부의사를 표시하지 아니하면 승인한 것으로 본다는 뜻을 명확하게 고지하였음에도 회원의 의사표시가 없는 경우에는 변경된 약관을 승인한 것으로 간주합니다.                    \\n                </li>\\n                <li>\\n                    <h3>제4조 (회원가입)</h3>\\n                    1.\\t이용자는 \\\"미니쉬라운지\\\" 가 정한 가입 양식에 따라 회원정보를 기입한 후 이 약관에 동의한다는 의사표시를 함으로써 회원가입을 신청합니다.<br>\\n                    \\n                    2.\\t\\\"미니쉬라운지\\\" 는 제1항과 같이 회원으로 가입할 것을 신청한 이용자 중 다음 각호에 해당하지 않는 한 회원으로 등록합니다.\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t가입신청자가 이 약관 제5조 제3항에 의하여 이전에 회원자격을 상실한 적이 있는 경우, 다만 제5조 제3항에 의한 회원자격 상실후 3년이 경과한 자로서 \\\"미니쉬라운지\\\" 의 회원재가입 승낙을 얻은 경우에는 예외로 한다.</li>\\n                        <li>나.\\t등록 내용에 허위, 기재누락, 오기가 있는 경우</li>\\n                        <li>다.\\t기타 “회원”으로 등록하는 것이 “미니쉬라운지”의 기술상 현저히 지장이 있다고 판단되는 경우</li>\\n                    </ul>\\n                    3.\\t회원가입계약의 성립시기는 \\\"미니쉬라운지\\\" 의 승인이 회원에게 도달한 시점으로 합니다.<br>\\t\\n                    4.\\t회원은 제9조 제1항에 의한 등록사항에 변경이 있는 경우, 즉시 전자우편 또는 기타 방법으로 \\\"미니쉬라운지\\\" 에 대하여 그 변경사항을 알려야 합니다.<br>\\n                            \\n                    5.\\t회원은 \\\"미니쉬라운지\\\" 를 통한 회원가입시 발급된 ID 하나로 제1조에 명시된 모든 미니쉬라운지의 서비스를 이용할 수 있습니다. 단, 일부 미니쉬라운지의 특정 서비스는 별도의 가입절차를 통하여 이용할 수 있으며, 이 경우 해당 미니쉬라운지의 이용시에는 해당 미니쉬라운지의 특정서비스에 대한 이용약관이 이 약관보다 우선 적용됩니다.                    \\n                </li>\\n                <li>\\n                    <h3>제5조 (회원 탈퇴 및 자격 상실 등)</h3>\\n                    1.\\t다음의 경우 회원탈퇴가 가능합니다.\\n                    가.\\t회원은 \\\"미니쉬라운지\\\" 에 언제든지 탈퇴를 요청할 수 있으며 \\\"미니쉬라운지\\\" 는 즉시 회원탈퇴를 처리합니다.\\n                    나.\\t관련 법령으로 정한 기간 동안 이용 실적이 없는 경우, 자동으로 탈퇴처리 됩니다.\\n                    다.\\t“미니쉬라운지”가 폐쇄되는 경우, 자동으로 탈퇴처리 됩니다.\\n                    라.\\t회원은 제4조 제2항 나, 항목의 경우, 회원탈퇴를 처리합니다.<br>\\n                    2.\\t회원의 개인정보는 원칙적으로 개인정보의 수집 및 이용목적이 달성되면 지체 없이 파기합니다. 단, 관련법령에 의한 정보 보유사유로 명시한 기간 동안 보존합니다.\\n                    <table class=\\\"row-table\\\">\\n                        <tbody><tr>\\n                            <td>항목</td>\\n                            <td>계약 또는 청약 철회 등에 관한 기록</td>\\n                        </tr>\\n                        <tr>\\n                            <td>보존이유</td>\\n                            <td>전자상거래 등에서의<br> 소비자 보호에 관한 법률</td>\\n                        </tr>\\n                        <tr>\\n                            <td>보존기간</td>\\n                            <td>5년</td>\\n                        </tr>\\n                    </tbody></table>                \\n                    <table class=\\\"row-table\\\">\\n                        <tbody><tr>\\n                            <td>항목</td>\\n                            <td>대금 결제 및 재화 등의 공급에 관한 기록</td>\\n                        </tr>\\n                        <tr>\\n                            <td>보존이유</td>\\n                            <td>전자상거래 등에서의<br> 소비자 보호에 관한 법률</td>\\n                        </tr>\\n                        <tr>\\n                            <td>보존기간</td>\\n                            <td>5년</td>\\n                        </tr>\\n                    </tbody></table>                \\n                    <table class=\\\"row-table\\\">\\n                        <tbody><tr>\\n                            <td>항목</td>\\n                            <td>소비자의 불만 또는 분쟁 처리에 관한 기록</td>\\n                        </tr>\\n                        <tr>\\n                            <td>보존이유</td>\\n                            <td>전자상거래 등에서의<br> 소비자 보호에 관한 법률</td>\\n                        </tr>\\n                        <tr>\\n                            <td>보존기간</td>\\n                            <td>6개월</td>\\n                        </tr>\\n                    </tbody></table>                \\n                    <table class=\\\"row-table\\\">\\n                        <tbody><tr>\\n                            <td>항목</td>\\n                            <td>본인 확인에 관한 기록</td>\\n                        </tr>\\n                        <tr>\\n                            <td>보존이유</td>\\n                            <td>정보통신망 이용 촉진 및<br> 정보 보호 등에 관한 법률</td>\\n                        </tr>\\n                        <tr>\\n                            <td>보존기간</td>\\n                            <td>3년</td>\\n                        </tr>\\n                    </tbody></table>                \\n                    <table class=\\\"row-table\\\">\\n                        <tbody><tr>\\n                            <td>항목</td>\\n                            <td>방문에 관한 기록</td>\\n                        </tr>\\n                        <tr>\\n                            <td>보존이유</td>\\n                            <td>통신비밀보호법</td>\\n                        </tr>\\n                        <tr>\\n                            <td>보존기간</td>\\n                            <td>5년</td>\\n                        </tr>\\n                    </tbody></table>                \\n                    3.\\t회원이 다음 각호의 사유에 해당하는 경우, \\\"미니쉬라운지\\\" 는 회원자격을 제한 및 정지시킬 수 있습니다.\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t가입 신청시에 타인의 정보 또는 허위 내용을 등록한 경우</li>\\n                        <li>나.\\t\\\"미니쉬라운지\\\" 서비스 이용 등의 대금, 기타 \\\"미니쉬라운지\\\" 이용에 관련하여 회원이 부담하는 채무를 기일에 지급하지 않는 경우</li>\\n                        <li>다.\\t다른 사람의 \\\"미니쉬라운지\\\" 이용을 방해하거나 그 정보를 도용하는 등 전자상거래 질서를 위협하는 경우</li>\\n                        <li>라.\\t부정한 방법으로 포인트를 적립하거나 포인트를 부정 사용하는 등 포인트 서비스 제도운영을 방해한 경우</li>\\n                        <li>마.\\t\\\"미니쉬라운지\\\" 를 이용하여 법령 또는 이 약관이 금지하거나 공서양속에 반하는 행위를 하는 경우</li>\\n                    </ul>\\n                    4.\\t\\\"미니쉬라운지\\\" 가 회원 자격을 제한, 정지 시킨후, 동일한 행위가 2회이상 반복되거나 30일이내에 그 사유가 시정되지 아니하는 경우 \\\"미니쉬라운지\\\" 는 회원자격을 상실시킬 수 있습니다.<br>\\n                    5.\\t\\\"미니쉬라운지\\\" 가 회원자격을 상실시키는 경우에는 회원등록을 말소합니다. 이 경우 회원에게 이를 통지하고, 회원등록 말소전에 최소한 30일 이상의 기간을 정하여 소명할 기회를 부여합니다.\\n                </li>\\n                <li>\\n                    <h3>제6조 (회원에 대한 통지)</h3>\\n                    1.\\t\\\"미니쉬라운지\\\" 가 회원에 대한 통지를 하는 경우, 회원이 \\\"미니쉬라운지\\\" 와 미리 약정하여 지정한 전자우편 주소로 할 수 있습니다.<br>\\n                    \\n                    2.\\t\\\"미니쉬라운지\\\" 는 불특정다수 회원에 대한 통지의 경우 1주일이상 \\\"미니쉬라운지\\\" 게시판에 게시함으로써 개별 통지에 갈음할 수 있습니다. 다만, 회원 본인의 거래와 관련하여 중대한 영향을 미치는 사항에 대하여는 개별통지를 합니다.                    \\n                </li>\\n                <li>\\n                    <h3>제7조 (서비스의 제공 및 변경)</h3>\\n                    1.\\t\\\"미니쉬라운지\\\" 는 다음과 같은 업무를 수행합니다.\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t서비스 또는 용역에 대한 정보 제공 및 이용계약의 체결</li>\\n                        <li>나.\\t이용계약이 체결된 서비스 또는 용역의 이행</li>\\n                        <li>다.\\t기타 “미니쉬라운지” 가 정하는 서비스</li>\\n                    </ul>\\n                    2.\\t\\\"미니쉬라운지\\\" 는 서비스 또는 용역의 계약 종료 또는 기술적 사양의 변경 등의 경우에는 장차 체결되는 계약에 의해 제공할 서비스 또는 용역의 내용을 변경할 수 있습니다. 이 경우에는 변경된 서비스 또는 용역의 내용 및 제공일자를 명시하여 현재의 서비스 또는 용역의 내용을 게시한 곳에 즉시 공지합니다.<br>\\n                            \\n                    3.\\t\\\"미니쉬라운지\\\" 가 제공하기로 이용자와 계약을 체결한 서비스의 내용을 용역과의 계약 종료 또는 기술적 사양의 변경 등의 사유로 변경할 경우에는 그 사유를 이용자에게 통지 가능한 주소로 즉시 통지합니다.<br>\\n                            \\n                    4.\\t\\\"미니쉬라운지\\\" 는 제3항으로 인하여 이용자가 입은 손해를 배상합니다. 다만, \\\"미니쉬라운지\\\" 가 고의 또는 과실이 없음을 입증하는 경우에는 그러하지 아니합니다.\\n                </li>\\n                <li>\\n                    <h3>제8조 (서비스의 중단)</h3>\\n                    1.\\t\\\"미니쉬라운지\\\"는 천재지변을 포함한 불가항력적인 사유, 시설고장 및 보수점검, 미리 고지된 사유 등의 경우에는 서비스의 제공을 일시적으로 중단할 수 있습니다.<br>\\n                    \\n                    2.\\t사업종목의 전환, 사업의 포기, 업체간의 통합 등의 이유로 서비스를 제공할 수 없게 되는 경우 \\\"미니쉬라운지\\\"는 제8조에 정한 방법으로 이용자에게 통지하고 당초 \\\"미니쉬라운지\\\"에서 제시한 조건에 따라 소비자에게 보상합니다. 다만, \\\"미니쉬라운지\\\"가 보상기준 등을 고지하지 아니한 경우에는 이용자들의 포인트 또는 적립금 등을 \\\"미니쉬라운지\\\"에서 통용되는 통화가치에 상응하는 현물 또는 현금으로 이용자에게 지급합니다.                    \\n                </li>\\n                <li>\\n                    <h3>제9조 (청약철회 등)</h3>\\n                    1.\\t\\\"미니쉬라운지\\\" 와 서비스 등의 구매에 관한 계약을 체결한 이용자는 수신확인의 통지를 받은 날부터 7일 이내에는 청약의 철회를 할 수 있습니다.<br>\\n                    \\n                    2.\\t\\\"미니쉬라운지\\\" 가 사전에 청약철회 등이 제한되는 사실을 소비자가 쉽게 알 수 있는 곳에 명기하거나 시용상품을 제공하는 등의 조치를 하지 않았다면 이용자의 청약철회 등이 제한되지 않습니다.                    \\n                </li>\\n                <li>\\n                    <h3>제10조 (예약환불)</h3>\\n                    1.\\t예약 가능 날짜 및 시간\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t라운지에서 제공하는 모든 온라인 예약서비스는 이용하시고자 하는 당일 예약 시간의 2시간전까지 예약 시간 및 내용에 대한 수정 및 취소도 가능합니다.</li>\\n                        <li>나.\\t단 입력하신 서비스 이용 예약 시간의 2시간전 이후부터는 예약수정 및 취소가 불가능합니다.</li>\\n                    </ul>\\n                    2.\\t예약/결제 취소에 대한 환불\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t예약시간 2시간 전까지 취소 시 예약금의 100% 환불 처리됩니다.</li>\\n                        <li>나.\\t예약시간 2시간 전 이후에 취소 또는 미방문 시,결제 금액에서 10%의 취소 수수료 공제후,예약금의 90% 환불 처리됩니다.</li>\\n                    </ul>\\n                </li>\\n                <li>\\n                    <h3>제11조 (개인정보보호)</h3>\\n                    1.\\t\\\"미니쉬라운지\\\" 는 이용자의 정보수집시 서비스 이용계약 이행에 필요한 최소한의 정보를 수집합니다. 다음 사항을 필수사항으로 하며 그 외 사항은 선택사항으로 합니다.\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t성명</li>\\n                        <li>나.\\t통신사</li>\\n                        <li>다.\\t핸드폰번호</li>\\n                        <li>라.\\t비밀번호(회원의 경우)</li>\\n                    </ul>\\n                    2.\\t\\\"미니쉬라운지\\\" 가 이용자의 개인식별이 가능한 개인정보를 수집하는 때에는 반드시 당해 이용자의 동의를 받습니다.<br>\\n                    \\n                    3.\\t제공된 개인정보는 당해 이용자의 동의없이 목적외의 이용이나 제3자에게 제공할 수 없으며, 이에 대한 모든 책임은 \\\"미니쉬라운지\\\" 에 있습니다.<br>\\n                    \\n                    다만, 다음의 경우에는 예외로 합니다.\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t통계작성, 학술연구 또는 시장조사를 위하여 필요한 경우로서 특정 개인을 식별할 수 없는 형태로 제공하는 경우</li>\\n                        <li>나.\\t서비스 등 이용에 따른 대금정산을 위하여 필요한 경우</li>\\n                        <li>다.\\t도용방지를 위하여 본인확인에 필요한 경우</li>\\n                        <li>라.\\t법률의 규정 또는 법률에 의하여 필요한 불가피한 사유가 있는 경우</li>\\n                    </ul>\\n                    4.\\t\\\"미니쉬라운지\\\" 가 제2항과 제3항에 의해 이용자의 동의를 받아야 하는 경우에는 개인정보관리 책임자의 신원(소속, 성명 및 전화번호, 기타 연락처), 정보의 수집목적 및 이용목적, 제3자에 대한 정보제공 관련사항(제공받은자, 제공목적 및 제공할 정보의 내용) 등 정보통신망이용촉진등에관한법률 제22조 제2항이 규정한 사항을 미리 명시하거나 고지해야 하며 이용자는 언제든지 이 동의를 철회할 수 있습니다.<br>\\n                    \\n                    5.\\t이용자는 언제든지 \\\"미니쉬라운지\\\" 가 가지고 있는 자신의 개인정보에 대해 열람 및 오류정정을 요구할 수 있으며 \\\"미니쉬라운지\\\" 는 이에 대해 지체없이 필요한 조치를 취할 의무를 집니다.이용자가 오류의 정정을 요구한 경우에 \\\"미니쉬라운지\\\" 는 그 오류를 정정할 때까지 당해 개인정보를 이용하지 않습니다.<br>\\n                    \\n                    6.\\t\\\"미니쉬라운지\\\" 는 개인정보 보호를 위하여 관리자를 한정하여 그 수를 최소화하며 이용자의 개인정보의 분실, 도난, 유출, 변조 등으로 인한 이용자의 손해에 대하여 모든 책임을 집니다.<br>\\n                    \\n                    7.\\t\\\"미니쉬라운지\\\" 또는 그로부터 개인정보를 제공받은 제3자는 개인정보의 수집목적 또는 제공받은 목적을 달성한 때에는 당해 개인정보를 지체없이 파기합니다.\\n                </li>\\n                <li>\\n                    <b3>제12조 (분쟁해결)</b3>\\n                    1.\\t\\\"미니쉬라운지\\\" 는 이용자가 제기하는 정당한 의견이나 불만을 반영하고 그 피해를 보상처리하기 위하여 고객센터를 설치,운영합니다.<br>\\n                    \\n                    2.\\t\\\"미니쉬라운지\\\" 는 이용자로부터 제출되는 불만사항 및 의견은 우선적으로 그 사항을 처리합니다. 다만, 신속한 처리가 곤란한 경우에는 이용자에게 그 사유와 처리일정을 즉시 통보해 드립니다.<br>\\n                            \\n                    3.\\t\\\"미니쉬라운지\\\" 와 이용자간에 발생한 분쟁과 관련하여 이용자의 피해구제신청이 있는 경우에는 공정거래위원회 또는 시•도지사가 의뢰하는 분쟁조정기관의 조정에 따를 수 있습니다.\\n                </li>\\n                <li>\\n                    <h3>부칙</h3>\\n                    이 약관은 2022년 3월 18일부터 적용됩니다.<br>\\n                    (공고일자 : 2022년 3월 18일 / 시행일자 : 2022년 3월 18일)\\t                    \\n                </li>\\n            </ul>\",\"admin_seqno\":2}'),(1584,2,'admin','2022-07-10 22:12:02','콘텐츠관리>개인정보약관','개인정보처리방침 수정','210.99.190.4','{\"title\":\"약관 test\",\"contents\":\"\\n            <h2>미니쉬라운지 개인정보처리방침</h2>\\n            <ul class=\\\"txt_wrap\\\">\\n                <li>\\n                    미니쉬테크놀로지 주식회사(이하 “미니쉬테크”)가 운영하는 미니쉬라운지(이하 “라운지”)는 「개인정보보호법」 제30조에 따라 정보주체의 개인정보를 보호하고 이와 관련한 고충을 신속하고 원활하게 처리할 수 있도록 하기 위하여 다음과 같이 개인정보처리방침을 수립•공개합니다.\\n                    본 개인정보처리방침은 법률의 제•개정, 정부의 정책 변경, 회사의 내부 방침의 변경에 따라 변경될 수 있으며, 수시로 확인하여 주시기 바랍니다.    \\n                </li>\\n                <li>\\n                    본 개인정보처리방침은 다음과 같은 내용을 담고 있습니다.<br>\\n                    제1조 개인정보의 수집 범위<br>\\n                    제2조 개인정보의 수집 및 이용목적\\n                    제3조 개인정보의 처리기간<br>\\n                    제4조 개인정보의 제3자 제공<br>\\n                    제5조 개인정보처리업무의 위탁<br>\\n                    제6조 정보주체와 법정대리인의 권리•의무 및 행사방법<br>\\n                    제7조 개인정보의 파기<br>\\n                    제8조 개인정보의 안정성 확보 조치<br>\\n                    제9조 쿠키의 운용 및 활용<br>\\n                    제10조 개인정보 보호책임자<br>\\n                    제11조 권익침해 구제방법<br>\\n                    제12조 개인정보 처리방침의 변경\\n                </li>\\n                <li>\\n                    <h3>제1조 (개인정보의 수집 범위)</h3>\\n                    라운지는 적법하고 공정한 수단에 의하여 서비스 제공을 위하여 필요한 최소한의 범위 내에서 개인정보를 수집하고 있습니다.\\n                    수집하는 개인정보는 기본적 인권을 침해할 우려가 있는 민감한 개인정보(인종, 종교, 사상, 출신지, 본적지, 정치적 성향 및 범죄기록, 건강상태 및 성생활 등)는 기본적으로 수집하지 않습니다. 단, 특정 프로그램 이용 시 민감정보 중 일부 수집하며 그 경우 별도 안내를 통해 동의를 구합니다.                    \\n                </li>\\n                <li>\\n                    <h3>제2조 (개인정보의 수집 및 이용목적)</h3>\\n                    라운지는 다음과 같은 목적을 위해 개인정보를 처리하고 있습니다. 처리하고 있는 개인정보는 다음의 목적 이외의 용도로는 수집∙이용하지 않으며, 그 목적이 변경되거나 원래 목적 이외의 목적으로 활용될 경우에는 개인정보보호법 제18조에 따라 별도의 정보주체의 동의를 받는 등 필요한 조치를 이행할 예정입니다.                    \\n                </li>\\n                <li>\\n                    「개인정보보호법」 제24조 2항에 따라 2014년 8월 7일부터 ‘주민등록번호’의 처리가 제한되고 있으나 법령에서 구체적으로 주민등록번호의 처리를 요구하거나 허용하는 경우에는 예외적 처리가 가능하며, 이에 따라 당사는 관광진흥법 시행규칙 제28조에서 규정하고 있는 회원증의 발급을 위해 회원의 주민등록번호를 수집∙이용 및 제3자 제공이 가능함을 알려드립니다.\\n                    <ul class=\\\"depth\\\">\\n                        <li>- 정보 수집•이용•제공 동의는 거부할 수 있으나 필수적 정보 및 고유식별정보에 대한 동의가 없을 경우 거래관계의 설정 또는 유지가 불가능 할 수 있음을 알려드립니다.</li><br>\\n                        <li>- 선택적 정보의 처리에 관한 동의는 거부하실 수 있으나, 동의하지 않는 경우 일부 서비스 및 편의제공 등에 제한이 있을 수 있음을 알려드립니다.</li>\\n                    </ul>\\n                </li>\\n                <li>\\n                    <h3>제3조 (개인정보의 처리 기간)</h3>\\n                    1.\\t라운지는 이용자 또는 멤버십 회원의 개인정보 삭제 요청 시에는 수집된 개인정보가 열람 또는 이용될 수 없도록 즉시 처리합니다.<br>\\n                    2.\\t하지만, 해지 시 상법 등 법령의 규정에 의하여 더 보존할 필요성이 있는 경우에는 법령에서 규정한 보존기간 동안 거래내역과 최소한의 기본정보를 보유할 수 있으며 보유기간을 미리 고지하거나 개별적으로 동의를 받은 경우에는 약속한 보존기간 동안 개인정보를 보유합니다. 이 경우, 라운지는 보유하는 정보를 그 보유 목적으로만 이용하며, 보존기간은 아래와 같습니다.\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t계약 또는 청약철회 등에 관한 기록 5년</li>\\n                        <li>나.\\t대금결제 및 재화 등의 공급에 관한 기록 5년</li>\\n                        <li>다.\\t소비자의 불만 또는 분쟁처리에 관한 기록 3년</li>\\n                    </ul>\\n                </li>\\n                <li>\\n                    <h3>제4조 (개인정보의 제3자 제공)</h3>\\n                    1.\\t라운지는 정보주체의 동의가 있거나 관련 법령의 규정에 의한 경우를 제외하고는 어떠한 경우에도 “제2조 개인정보의 수집 및 이용목적”에서 고지한 범위를 넘어 개인정보를 이용하거나 타인 또는 타기업/기관에 제공 하지 않습니다.<br>\\n                    2.\\t라운지가정보주체의 사전동의 없이 개인정보를 제 3자에게 제공할 수 있는 경우는 다음과 같습니다.\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t정보주체의 사전 동의를 얻은 경우</li>\\n                        <li>나.\\t통신비밀보호법, 정보통신망 이용촉진 및 정보보호에 관한 법률, 금융실명거래 및 비밀보장에 관한 법률, 신용정보의 이용 및 보호에 관한 법률, 전기통신기본법, 전기통신사업법, 소비자보호법, 형사소송법 등 법률에 특별한 규정이 있는 경우 및 수사 목적으로 법령에 정해진 절차와 방법에 따라 수사기관의 요구가 있는 경우</li>\\n                        <li>다.\\t통계작성, 학술연구 또는 시장조사를 위하여 필요한 경우 특정 개인을 알아볼 수 없는 형태로 가공하여 제공하는 경우</li>\\n                    </ul>\\n                    3.\\t한편 보다 더 질 높은 서비스 제공을 위하여 정보주체의 개인정보를 제휴사에 제공하거나 또는 제휴사와 공유할 수 있습니다. 개인정보를 제공하거나 공유할 경우 개인정보를 제공 받는 자, 이용목적, 개인정보 제공 항목, 보유 및 이용기간에 대해 개별적으로 전자우편, 인터넷 홈페이지, 전화 및 서면을 통해 동의를 구하는 절차를 거치게 되며, 정보주체의 동의가 없을 경우에는 제휴사에 제공하거나 제휴사와 공유하지 않습니다. 라운지의개인정보 제공은 라운지만의 서비스를 제공하기 위한 것이므로 제공에 대한 동의를 하지 아니하면 정상적인 서비스 제공 및 이용이 불가능 할 수 있습니다.\\n                </li>\\n                <li>\\n                    <h3>제5조 (개인정보처리업무의 위탁)</h3>\\n                    라운지는 서비스 이행을 위해 아래와 같이 개인정보를 위탁하고 있으며, 관계법령에 따라 위탁계약서에 개인정보가 안전하게 관리 될 수 있도록 필요한 사항을 규정하고 있습니다. 위탁을 받은 업체는 위탁을 받은 목적을 벗어나서 개인정보를 이용할 수 없습니다. 또한 라운지는 이러한 위탁업체에 대하여 해당 개인정보가 위법하게 이용되지 않도록 정기적인 감시와 감독을 실시하고, 업무의 일부를 위탁하는 경우 정보주체에게 미리 그 사실을 고지합니다. 개인정보 위탁업체는 다음과 같습니다.\\n                    <table>\\n                        <tbody><tr>\\n                            <td>수탁사</td>\\n                            <td>위탁업무 내용</td>\\n                        </tr>\\n                        <tr>\\n                            <td>발몽스파</td>\\n                            <td>스파제공</td>\\n                        </tr>\\n                        <tr>\\n                            <td>딥포커스</td>\\n                            <td>검안제공</td>\\n                        </tr>\\n                        <tr>\\n                            <td>바라는네일</td>\\n                            <td>네일제공</td>\\n                        </tr>\\n                    </tbody></table>\\n                </li>\\n                <li>\\n                    <h3>제6조 (정보주체와 법정대리인의 권리•의무 및 행사방법)</h3>\\n                    1.\\t정보주체는라운지에 대해 언제든지 다음 각 호의 개인정보보호 관련 권리를 행사할 수 있습니다.\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t개인정보 열람요구</li>\\n                        <li>나.\\t변경 및 오류 등이 있을 경우 정정요구</li>\\n                        <li>다.\\t삭제요구</li>\\n                        <li>라.\\t처리정지 요구</li>\\n                    </ul>\\n                    2.\\t제1항에 따른 권리 행사는 라운지에 대해 「개인정보보호법 시행규칙」 별지 제8호, 제10호 서식에 따라 서면, 전자우편, 모사전송(FAX) 등을 통하여 하실 수 있으며 라운지는 이에 대해 지체 없이 조치해 드릴 것입니다. 정보주체가 개인정보의 오류 등에 대한 정정 또는 삭제를 요구한 경우에는 라운지는 정정 또는 삭제를 완료할 때까지 해당 개인정보를 이용하거나 제공하지 않습니다.<br>\\n                    3.\\t제1항에 따른 권리 행사는 정보주체의 법정대리인이나 위임을 받은 자 등 대리인을 통하여 하실 수 있습니다. 이 경우 「개인정보보호법 시행규칙」 별지 제11호 서식에 따른 위임장을 제출하셔야 합니다.<br>\\n                    4.\\t개인정보 열람 및 처리정지 요구는 「개인정보보호법」 제35조 제5항, 제37조 제2항에 의하여 정보주체의 권리가 제한될 수 있습니다.<br>\\n                    5.\\t개인정보의 정정 및 삭제 요구는 다른 법령에서 그 개인정보가 수집 대상으로 명시되어 있는 경우에는 그 삭제를 요구할 수 없습니다.<br>\\n                    6.\\t라운지는 정보주체 권리에 따른 열람의 요구, 정정•삭제의 요구, 처리정지의 요구 시 열람 등 요구를 한 자가 본인이거나 정당한 대리인이지를 확인합니다.\\n                </li>\\n                <li>\\n                    <h3>제7조 (개인정보의 파기)</h3>\\n                    1.\\t라운지는 개인정보 보유기간의 경과, 처리목적 달성 등 개인정보가 불필요하게 되었을 때에는 지체없이 해당 개인정보를 파기합니다.<br>\\n                    2.\\t정보주체로부터 동의 받은 개인정보 보유기간이 경과하거나 처리목적이 달성되었음에도 불구하고 다른 법령에 따라 개인정보를 계속 보존하여야 하는 경우, 회사는 해당 개인정보를 별도의 데이터베이스(DB)로 옮기거나 보관장소를 달리하여 보존합니다.<br>\\n                    3.\\t개인정보 파기의 절차 및 방법은 다음과 같습니다.\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t파기절차: 라운지는 파기 사유가 발생한 개인정보를 선정하고, 개인정보 보호책임자의 승인을 받아 개인정보를 파기합니다.</li>\\n                        <li>나.\\t파기방법: 종이에 출력된 개인정보는 분쇄하거나 소각하여 파기하고, 전자적 파일 형태로 기록•저장된 개인정보는 복원할 수 없는 기술적 방법을 사용하여 영구 삭제합니다.</li>\\n                    </ul>                    \\n                </li>\\n                <li>\\n                    <h3>제8조 (개인정보의 안정성 확보 조치)</h3>\\n                    <p>라운지는 「개인정보보호법」 제 29조에 따라 다음과 같이 안전성 확보에 필요한 기술적/관리적 및 물리적 조치를 취하고 있습니다.</p>\\n                    \\n                    1.\\t관리적 조치\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t개인정보보호를 위해 개인정보 처리자에 대한 권한 부여를 최소화하고 있습니다.</li>\\n                        <li>나.\\t개인정보보호에 대한 인식 제고를 위해 정기적인 교육을 시행하고 있습니다.</li>\\n                        <li>다.\\t개인정보의 처리 관련 안정성 확보를 위해 정기적으로 자체 점검을 실시하고 있습니다.</li>\\n                    </ul>\\n                    2.\\t기술적 조치\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t개인정보의 안전한 처리 및 관리를 위해 내부관리계획을 수립하여 관리하고 있습니다.</li>\\n                        <li>나.\\t정보주체의 개인정보와 비밀번호는 암호화되어 저장•관리되고 있으며 전송 시에도 별도의 보안기능을 사용하여 안전하게 관리하고 있습니다.</li>\\n                        <li>다.\\t해킹이나 컴퓨터 바이러스 등에 의한 개인정보 유출 및 훼손을 막기 위하여 보안 프로그램을 설치하고 주기적인 갱신•점검을 하여 외부로부터 접근이 통제된 구역에 시스템을 설치하고 기술적, 물리적으로 감시 및 차단하고 있습니다.</li>\\n                        <li>라.\\t개인정보를 처리하는 데이터베이스시스템에 대한 접근권한의 부여, 변경, 말소를 통하여 개인정보에 대한 접근통제를 위하여 필요한 조치를 하고 있으며 침입차단 시스템을 이용하여 외부로부터의 무단 접근을 통제하고 있습니다.</li>\\n                    </ul>\\n                    3.\\t물리적 조치\\n                    <ul class=\\\"depth\\\">\\n                        <li>가.\\t개인정보가 포함된 서류, 보조저장매체 등을 잠금장치가 있는 안전한 장소에 보관하고 있습니다.</li>\\n                        <li>나.\\t개인정보를 보관하고 있는 물리적 보관 장소를 별도로 두고 이에 대해 출입통제 절차를 수립, 운영하고 있습니다.</li>\\n                        <li>다.\\t천재지변을 비롯한 재해, 재난 발생에 대비하여 위기대응 매뉴얼 등 대응절차를 마련하고 점검하고 있습니다.</li>\\n                    </ul>\\n                </li>\\n                <li>\\n                    <h3>제9조 (쿠키의 운용 및 활용)</h3>\\n                    1.\\t쿠키(cookie) 운용\\n                    라운지는 이용자의 편의를 위하여 ‘쿠키’를 운영하며, 쿠키를 통해 수집된 정보는 접속 빈도, 방문 시간 등을 분석하여 맞춤화된 마케팅 서비스에 이용합니다.<br>\\n                    2.\\t쿠키(cookie)의 설치•운영 및 거부\\n                    고객은 쿠키 설치에 대한 선택권을 가지고 있으며, 웹브라우져에서 옵션을 설정하여 모\\n                    든 쿠키를 허용하거나, 쿠키가 저장될 때마다 확인을 거치게 하거나 아니면 쿠키의 저장\\n                    을 거부할 수 있습니다. 단, 쿠키저장을 거부하였을 경우 로그인이 필요한 서비스에 일부 \\n                    제한이 있을 수 있습니다.                    \\n                </li>\\n                <li>\\n                    <h3>제10조 (개인정보 보호책임자)</h3>\\n                    <p>라운지는 개인정보 처리에 관한 업무를 총괄해서 책임지고, 개인정보 처리와 관련한 정보주체의 불만처리 및 피해구제 등을 위하여 아래와 같이 개인정보 보호책임자 및 담당자를 지정하고 있습니다. 개인정보와 관련된 문의사항이 있으시면 아래의 개인정보 보호책임자 또는 보호담당자에게 연락 주시기 바랍니다. 문의하신 사항에 대해서 신속하고 성실하게 답변해 드리겠습니다.</p><br>\\n                    개인정보 보호책임자\\n                    <table>\\n                        <tbody><tr>\\n                            <td>성명</td>\\n                            <td>소속</td>\\n                            <td>직책/직위</td>\\n                            <td>연락처</td>\\n                            <td>이메일</td>\\n                        </tr>\\n                        <tr>\\n                            <td>박희진</td>\\n                            <td>기획팀</td>\\n                            <td>대리</td>\\n                            <td>010-3575-5054</td>\\n                            <td></td>\\n                        </tr>\\n                        <tr>\\n                            <td>문성모</td>\\n                            <td>개발팀</td>\\n                            <td>팀장</td>\\n                            <td>010-2974-0017</td>\\n                            <td></td>\\n                        </tr>\\n                    </tbody></table>                    \\n                </li>\\n                <li>\\n                    <h3>제11조 (권익침해 구제방법)</h3>\\n                    <p>정보주체는 아래의 기관을 통하여 개인정보 침해에 대한 피해구제, 상담 등을 하실 수 있음을 알려드립니다.</p><br>\\n                    1.\\t개인정보 침해신고센터 (한국인터넷진흥원 운영)\\n                    <ul class=\\\"depth\\\">\\n                        <li>-\\t소관업무: 개인정보 침해사실 신고, 상담 신청</li>\\n                        <li>-\\t홈페이지: privacy.kisa.or.kr</li>\\n                        <li>-\\t전화: (국번없이) 118</li>\\n                        <li>-\\t주소: (58324) 전남 나주시 진흥길 9(빛가람동 301-2) 3층 개인정보침해신고센터</li>\\n                    </ul>\\n                    2.\\t개인정보 분쟁조정위원회\\n                    <ul class=\\\"depth\\\">\\n                        <li>-\\t소관업무: 개인정보 분쟁조정신청, 집단분쟁조정 (민사적 해결)</li>\\n                        <li>-\\t홈페이지: <a href=\\\"http://www.kopico.go.kr\\\">www.kopico.go.kr</a></li>\\n                        <li>-\\t전화: (국번없이) 1833-6972</li>\\n                        <li>-\\t주소: (03171)서울특별시 종로구 세종대로 209 정부서울청사 4층</li>\\n                    </ul>\\n                    3.\\t대검찰청 사이버범죄수사단\\n                    <ul class=\\\"depth\\\">\\n                        <li>-\\t전화: 02-3480-3573</li>\\n                        <li>-\\t홈페이지: <a href=\\\"http://www.spo.go.kr\\\">www.spo.go.kr</a></li>\\n                        <li>-\\t경찰청 사이버안전국</li>\\n                        <li>-\\t전화: 