INSERT INTO `partner` VALUES (1,2,'미니쉬구강스파','000-0-0001','/storage/file_store/FqGqHNQCfFqmm4jjPraQuP6aHmomvWfSM0iIlfgn.jpg','010-0000-0000','통-0000-0-0000','/storage/file_store/3BkKUDKG9R2WD9JhJNx5z5brfcDqdF3BROrMPeC3.png','미니쉬 구강 스파 관리자','010-1234-1224','botbinoo@naver.com',0,'Y','2022-04-27 14:37:08','2022-07-13 12:56:36','MINISH Dental Spa','/user/img/img_brand01.png','/user/img/icon_minish_spa.svg','<p>‘나 자신도 몰랐던 입속 상태를 정확히 진단받고, 건강한 구강 관리가 가능토록 미니쉬가 만들었습니다.’</p><p>미니쉬 스파에서는 구강질환이 발생하지 않도록 예방하고 이미 발생한 구강질환은 비침습적 방법으로 관리할 수 있도록 개인별 구강 상태에 맞는 관리 프로그램을 진행해드립니다. 최첨단 의료 장비를 통해 구강질환의 원인 세균에 대한 분석, 전문가의 섬세한 손길을 통해 체계적인 구강 관리를 원하시는 분들께 추천하고 있습니다.</p>','/user/img/minish_spa01.jpg','','','','','미니쉬 치과 병원 구강관리 SPA 1:1<br>맞춤 관리 및 코칭 서비스','S6'),(2,1,'미니쉬발몽스파','000-0-00005','/storage/file_store/dOjVIpE6s1zBM3N2pZ8gcBy70HaqCW0hIE9fytyQ.png','010-0000-0000','통-0000-0-0000898','/storage/file_store/psFYJo0Q1L2dYhjW0hmomWOXeFRIVTtmeHlG4POe.png','미니쉬발몽스파 관리자','010-1234-1234','test@gmail.com',0,'N','2022-04-27 14:37:08','2022-07-20 11:32:54','MINISH Valmont Spa','/user/img/img_brand02.png','/user/img/icon_valmont_spa.svg','<p>스위스 발몽 코스메틱의 헤리티지와 미니쉬의 만남! 코코 샤넬, 찰리 채플린, 소피아 로렌 등 세계적인 유명인사들의 피부 재생 치료로 유명세를 탔던 발몽 클리닉. 1985년 그 병원 이름을 따 ‘발몽’이라는 화장품 브랜드가 탄생됐습니다. 스위스 천연 자원으로 만들어진 발몽 제품과 발몽 테크닉을 이용하여 얼굴 피부와 전신에 스며들게 합니다. 발몽의 노하우를 전수받은 숙련된 테라피스트가 함께하여, 당신의 아름다움을 되찾아 드립니다. 편안한 휴식을 위한 1인 1룸, 청결한 위생을 위한 1인 1시트, 체계적인 분석과 정밀한 진단을 통한 트리트먼트로 오직 고객만을 위한 시간과 공간을 선사합니다. 발몽스파에서 지금 바로 실현해보세요.</p>','/user/img/valmont_spa02.jpg','/user/img/valmont_spa01.jpg','/user/img/valmont_spa04.jpg','','','미니쉬 발몽 스파 스페셜 테라피','S3'),(3,2,'바라는 네일','000-0-0000','/storage/file_store/UEsbFxsyVdFHHmq8VP0CctuANCWylrwAnd5ffuUa.png','010-0000-0000','통-0000-0-0000','/storage/file_store/CL3cfuzj9TdnT9qhM5LYOjNcvpR2NuDyZEwUnxoB.png','바라는 네일 관리자','010-1234-1234','test@gmail.com',0,'N','2022-04-27 14:37:08','2022-06-07 02:09:59','Tomorrow’s wish','/user/img/img_brand03.png','/user/img/icon_nail.svg','<p>바라는 네일의 네일룸과 패디룸의 모든 공간은 고객님의 편안한 휴식 시간을 온전히 즐기실 수 있도록 준비되어있습니다. 바라는 네일에 들어오시는 순간부터 나가실 때까지 고객님 한분한분을 위한 맞춤관리로 프라이빗한 프리미엄 관리를 경험하실 수 있습니다.</p><p>파고드는 발톱관리 & 문제성 손발톱관리 & 물어뜯는 손톱관리 & 문제성 각질프리미엄 관리를 함께 만나실 수 있습니다.</p><p>고객님의 맞춤관리로 네일과 패디관리뿐만 아니라 휴식과 편안함을 즐기실 수 있는 공간을 제공해드립니다.</p>','/user/img/nail01.jpg','/user/img/nail02.jpg','/user/img/nail03.jpg','','','1:1 관리 예약 우선제 / 전문적인 케어','S2'),(4,2,'딥포커스 검안센터','000-0-0222','/storage/file_store/ObFXkQA89Q9l2SOthaE6E0nIOJ5PKVUZSr9RMMKZ.png','010-0000-3333','통-0000-0-0222','/storage/file_store/uk3XNeN5wQy6DQfhg7AT83awAli236LjlW7L5pYr.png','딥포커스 관리자','010-1234-1234','test@gmail.com',0,'N','2022-04-27 14:37:08','2022-06-08 18:21:07','Deep Focus','/user/img/img_brand04.png','/user/img/icon_deep_focus.svg','<p>‘검안에 눈뜨다’ 더 선명한 세상을 마주하는 DEEP FOCUS ‘유럽과 미국엔 보편화된 전문 검안 센터, 왜 한국에선 찾기 어려울까?’ ‘김광용 OPTICIAN’이 15여 년간 연구한 눈 중심 전문 검안 센터는 이처럼 간단한 질문에서 출발하였습니다.</p><p>익숙한듯 당연하지만, 하루하루 눈의 쓰임새는 정말 중요합니다. 특정 질환이 아니더라도 다양한 불편 증상이 생길 수 있습니다. 때문에 눈 질환과 시기능 이상은 구별이 필요합니다.</p><p>우리의 눈은 세상을 보고, 사랑하는 이의 눈을 마주하기도 합니다. 정밀하고 체계적인 검안 시스템을 갖춘 딥포커스에서 더욱 선명해질 당신의 시선을 약속합니다.</p>','/user/img/deep_focus01.jpg','/user/img/deep_focus02.jpg','','','','기존 뉴욕스토리안경원의<br>프리미엄 검안 전문체','S5'),(5,2,'미니쉬도수','000-0-0000','/storage/file_store/cHwuJofTEV1dhDqYOwUYqZXh2L1sPlCGx2vzUniL.png','010-0000-0000','통-0000-0-0000','/storage/file_store/S7dDRg51iO2NuAfCBoeHUOZgBwTfy1WuGa4maWTd.png','미니쉬도수 관리자','010-1234-1234','test@gmail.com',0,'N','2022-04-27 14:37:08','2022-06-07 02:10:36','MINISH Manual Therapy','/user/img/img_brand05.png','/user/img/icon_minish_manul_therapy.svg','<p>‘MANUAL THERAPY’, 모든 인체의 건강은 예방관리가 가장 중요합니다. 호감가는 인상을 결정하는 것은 이목구비 뿐 아니라 체형도 중요한 요인이 됩니다. 일상생활 속 잘못된 자세가 반복되면 그 사람의 체형으로 고착화됩니다.</p><p>미니쉬 도수에서는 관절 전문 병원 출신의 물리치료사의 체형교정 서비스를 제공하고 근골격의 변형예측, 근육 형상 검사가 가능한 장비를 활용한 검사 결과에 따라 개개인에 맞는 자가운동 치료 솔루션을 처방해드립니다. </p><p>멤버십 고객분들을 위한 미니쉬라운지청담만의 특별한 매뉴얼 테라피를 경험해보기시 바랍니다.</p>','/user/img/minish_manul_therapy01.jpg','/user/img/minish_manul_therapy02.jpg','/user/img/minish_manul_therapy03.jpg','/user/img/minish_manul_therapy04.jpg','','전문교육을 이수한 도수 치료사가 손을<br>이용하여 시행하는 프리미엄 물리치료','S7'),(6,2,'포레스타 블랙','000-0-0000','/storage/file_store/QVSVKJbwnk4YoUqB7hoCIARLwjDvbEXLaXWRNd5N.png','010-0000-0000','통-0000-0-0000','/storage/file_store/k0O9BAnS8XIC3GFhv1nyLPMGVDchL8rTYi4gUNp5.png','포레스타 블랙 관리자','010-1234-1234','test@gmail.com',0,'N','2022-04-27 14:37:08','2022-06-07 02:11:28','Foresta Black','/user/img/img_brand06.png','/user/img/icon_foresta_black.svg','<p>국내 최초이자 유일한 아베다의 뷰티 최상 등급인 라이프 스타일 살롱 ‘포레스타 블랙’</p><p>환경, 웰빙, 아름다움을 실천하는 아베다의 철학을 선보이며, 대표적인 친환경 브랜드인 아베다의 유기농 헤어 제품만을 사용하는 것을 원칙으로 합니다. 각 분야의 최고 전문가들이 특별한 여러분들을 위한 토탈 뷰티 서비스를 제공합니다. 아름다움을 위한 공간일 뿐만 아니라 도심 속 편안한 휴식 공간으로서, 내,외적인 균형을 통한 진정한 아름다움을 가꾸어 드립니다.</p>','/user/img/foresta_black01.jpg','','','','','국내 최초이자 유일한 아베다의 뷰티<br>최상 등급 라이프 살롱','S4'),(7,2,'테스트','111111','/storage/file_store/1Y3L5aXP9hTS7d6Qnu8mblQIcS9HAiTYy5MErI3N.jpg','1111','11111','/storage/file_store/VLQ18mwDhT1XvSdaSfFJi17cn736HlXIdFINWK8t.jpg','홍길동','010-1235-1234','bitf@naver.com',6,'Y','2022-05-27 02:59:11','2022-05-27 02:59:22','','','',NULL,'','','','','','',''),(8,1,'미니쉬구강스파','123','/storage/file_store/vNWenVBdkL0wd2Oxc9TnuRrvGosduBSgT3eDiR68.jpg','01012341234','1234','/storage/file_store/ZKKDywLL5tF0UR2yEwOZP9Sz7Hqw6I0DdcduIFqC.jpg','테스트','01012341234','botbinoo@naver.com',0,'N','2022-07-13 14:33:44','2022-07-20 11:45:10','MINISH Dental Spa','/user/img/img_brand01.png','/user/img/icon_minish_spa.svg','<p>‘나 자신도 몰랐던 입속 상태를 정확히 진단받고, 건강한 구강 관리가 가능토록 미니쉬가 만들었습니다.’</p><p>미니쉬 스파에서는 구강질환이 발생하지 않도록 예방하고 이미 발생한 구강질환은 비침습적 방법으로 관리할 수 있도록 개인별 구강 상태에 맞는 관리 프로그램을 진행해드립니다. 최첨단 의료 장비를 통해 구강질환의 원인 세균에 대한 분석, 전문가의 섬세한 손길을 통해 체계적인 구강 관리를 원하시는 분들께 추천하고 있습니다.</p>','/user/img/minish_spa01.jpg','','','','','미니쉬 치과 병원 구강관리 SPA 1:1<br>맞춤 관리 및 코칭 서비스','S6');
